import React from "react";
import './TrainingTable/styles/training-table-header.css';

const TrainingTableHeader = () => (
  <thead>
    <tr>
      <th>セット</th>
      <th>kg</th>
      <th>回</th>
      <th>タイマー</th>
      <th>完了</th>
      <th>操作</th>
    </tr>
  </thead>
);

export default TrainingTableHeader;
